import { useState, useEffect } from "react";
import { Modal, Button, Divider, Row, Col  } from "antd";

function Performance() {
  const [state, setState] = useState({
    modalVisible: false
  });

  const setModalVisible = modalVisible => {
    setState({
      ...state,
      modalVisible
    });
  };
  return (
    <div id="performance">
      <Row gutter={16} style={{width: '100%'}} >
        <Col span={4}>
          <div className="selection">
            <Button onClick={setModalVisible} block>
              Select Ad account
            </Button>
          </div>
        </Col>
        <Col span={2}>
            <Divider type="vertical" style={{'background-color':'blue'}}/>
        </Col>
        <Col span={18}>
            Performance
        </Col>
      </Row>
      <Modal
        title="Vertically centered modal dialog"
        centered
        visible={state.modalVisible}
        onOk={() => setModalVisible(false)}
        onCancel={() => setModalVisible(false)}
      >
        <p>some contents...</p>
        <p>some contents...</p>
        <p>some contents...</p>
      </Modal>
      <style jsx>
        {`
          #performance {
            display: flex;
            position: relative;
            margin-top: 70px;
            width: 100%;
          }

          .selection {
            display: flex;
            flex-direction: column;
          }

          .f-width{
              width: 100%;
          }
        `}
      </style>
    </div>
  );
}

export default Performance;
